// 这是一个查货核对的订单

// 引入react 
import React from 'react'
// 引入navs组件
import Navs from '../../../componets/nav'

// 引入ui库的input标签
import { InputItem } from 'antd-mobile';

// 引入 局部样式 
import IndexCss from './css/chahuo.module.scss'
// 引入DuvINp 组件
import InpDiv from '../../../componets/inp-shade'
class Chahuo extends React.Component {
    constructor(props) {
        super(props);
        this.state = {}
    }

    inputEl = this.refs.input;
    componentDidMount() {
        inputEl.focus()
    }
    render() {
        return (
            <div>
                <Navs name="查货核对" />
                <div className={IndexCss.chahuo}>
                    <div className={IndexCss.shipment}>
                        <InpDiv name="出货单号" />
                        <div className={IndexCss.chuhuodan}>
                            <div className={IndexCss.chuhuoTetx}>
                                出货单号
                            </div>
                            <InputItem

                            />
                        </div>
                    </div>
                    <div className={IndexCss.shipmentBox}>
                        <InpDiv name="出货箱" />
                        <div className={IndexCss.chuhuodan}>
                            <div className={IndexCss.chuhuoTetx}>
                                出货箱
                            </div>
                            <InputItem

                            />
                        </div>
                    </div>
                </div>
                <input ref="input" />
            </div>
        );
    }
}

export default Chahuo;
